Centuries ago, the evil Emperor Qin was cursed by the sorceress Zi Yuan who transformed him and his army into a mummies. In 1946, the explorer Rick O'Connell and his wife Evelyn O'Connell are invited by the British government to take the relic diamond &quot;The Eye of Shangri-La&quot; to China. The ancient stone is capable to resurrect the Emperor Qin and to point the way to Shangri-la and the eternal pool of life. When the couple reaches China, they meet their son Alex O'Connell, who has discovered the tomb of Qin, and Evelyn's brother Jonathan Carnahan. The O'Connells are betrayed by their friend Prof. Roger Wilson, who is associated to General Yang. Yang wants to serve Emperor Qin, so he resurrects the mummy and they head for Shangri la. The guardian of Qin's tomb (and Zi's daughter) Lin tells them that the only ways to destroy Qin are to prevent him from reaching Shangri-la or by stabbing his heart with a cursed dagger.

